import IncomeImg from '../../assets/income.svg'

import { Container } from "./styles";

export function Summary() {
  return (
    <Container >
      <div>
        <header>
          <p>Entries</p>
          <img src={IncomeImg} alt="Entries"/>
        </header>
        <strong>$1000.00</strong>
      </div>
    </Container>
  )
}
